declare @stringSplitVar1 varchar(10) = '</x>'; declare @stringSplitVar2 varchar(10) = '<x>'; declare @stringSplitDelim varchar(10) = ',';

IF OBJECT_ID('tempdb..#Enheter') IS NOT NULL DROP TABLE #Enheter create table #Enheter ( namn varchar(max) )
declare @toSplit as table (toSplit nvarchar(max)) insert into @toSplit select
',Vatten' +
',Team Vatten' +
',KlartVatten' +
',Klart Vatten%';
insert into #Enheter SELECT distinct SplitValue FROM  (select toSplit from @toSplit) q Cross Apply ( Select Seq   = Row_Number() over (Order By (Select null)) ,SplitValue = v.value('(./text())[1]', 'varchar(max)') From  (values (convert(xml,@stringSplitVar2 + replace(toSplit,@stringSplitDelim,@stringSplitVar1+@stringSplitVar2)+@stringSplitVar1))) x(n) Cross Apply n.nodes('x') node(v) ) B delete from @toSplit where toSplit is not null

declare @beteckningsColumnsDefenition as NVARCHAR(max)
    set @beteckningsColumnsDefenition = 'coalesce(case when nullif(strFastighetsbeteckning, space(0)) is not null and
				nullif(strSoekbegrepp, space(0)) is not null and
				nullif(strSoekbegrepp, space(0)) <> nullif(strFastighetsbeteckning, space(0)) and
				strSoekbegrepp not like concat(char(37), strFastighetsbeteckning, char(37))
			       then concat(strSoekbegrepp, space(2), strFastighetsbeteckning)
		      end, nullif(strFastighetsbeteckning, space(0)), nullif(strSoekbegrepp, space(0)),
		      nullif(strFnrID, space(0))) as  beteckning '

declare @arenden table
(
	socken varchar(max),strAerendemening nvarchar(255),HandelseDatum dateTime,antalFiler int
);


declare @HandelserFromperiod as NVARCHAR(max)

IF OBJECT_ID('tempdb..#rubRikerOfInterest ') IS NOT NULL DROP TABLE #rubRikerOfInterest  create table #rubRikerOfInterest  ( namn varchar(max) )
 insert into @toSplit select
			  			N'Klart vatten - information om avlopp' +
			  			N',Påminnelse om åtgärd - 12 månader' +
			  			N',Påminnelse om åtgärd-36 mån' +
			  			N',Påminnelse om åtgärd - 24 månader' +
			  			N',Påminnelse om åtgärd - 4 år' +
			  			N',Klart vatten information om avlopp'
insert into #rubRikerOfInterest  SELECT distinct SplitValue FROM  (select toSplit from @toSplit) q Cross Apply ( Select Seq   = Row_Number() over (Order By (Select null)) ,SplitValue = v.value('(./text())[1]', 'varchar(max)') From  (values (convert(xml,@stringSplitVar2 + replace(toSplit,@stringSplitDelim,@stringSplitVar1+@stringSplitVar2)+@stringSplitVar1))) x(n) Cross Apply n.nodes('x') node(v) ) B delete from @toSplit where toSplit is not null

set @HandelserFromperiod = 'left outer join ' +
	   '(
            select h.recAerendeID,strRubrik,datHaendelseDatum,intAntalFiler from ' +
	       'EDPVisionRegionGotland.dbo.vwAehHaendelse h' +
	   ' inner join #Enheter st ' +
	       'on st.namn = h.strAerendemening ' +
		   'OR st.namn = h.strAvdelningKod ' +
		   'OR st.namn = h.strEnhetKod ' +
		   'OR st.namn = h.strEnhetNamn ' +
	   'inner join #rubRikerOfInterest rr' +
	       ' on strRubrik = rr.namn
	    where datHaendelseDatum > datetimefromparts(2019,01,01,01,01,01,01)' +
	    ') H on h.recAerendeID = a.recAerendeID '

declare @query as NVARCHAR(max)
set @query = 'select distinct fran socken,h.strRubrik,h.datHaendelseDatum,h.intAntalFiler from ' +
	     '(select a.*,'+ @beteckningsColumnsDefenition+ ' from EDPVisionRegionGotland.dbo.vwAehAerende a
    			inner join #Enheter st on st.namn = a.strAerendemening ' +
	     'OR st.namn = a.strAvdelningKod ' +
	     'OR st.namn = a.strEnhetKod ' +
	     'OR st.namn = a.strEnhetNamn ' +
	     'OR st.namn = a.strProjektNamn ) a '
                + @HandelserFromperiod +
	     ' full outer join #pdfer on a.strDiarienummer = left(name,len(name)-5) and ' +

             'case when fran = ' + char(39) + 'uppfoljning2021' + char(39) +
             'then '+ char(39) + N'Påminnelse om åtgärd - 24 månader' + char(39)
	     +'else fran end = h.strRubrik'


insert into @arenden
	exec (@query)
;


select * from @arenden
--where socken is not null

